Here's an example of a vulnerable code snippet in Java that uses the ServletRequest's getReader() method to read user input without proper input validation, which can lead to a Cross-Site Scripting (XSS) vulnerability:

```java
// Vulnerable code snippet
import javax.servlet.*;
import java.io.*;

public class VulnerableServlet extends GenericServlet {
    public void service(ServletRequest request, ServletResponse response)
        throws ServletException, IOException {

        // Get the reader for the request input stream
        Reader reader = request.getReader();

        // Read user input and write it back to the response
        PrintWriter out = response.getWriter();
        out.print("User Input: " + reader.readLine());
    }
}
```

Now, here's a fixed version of the code that uses the ServletRequest's getParameter() method to read user input with proper input validation, which helps prevent XSS vulnerabilities:

```java
// Fixed code snippet
import javax.servlet.*;
import java.io.*;

public class FixedServlet extends GenericServlet {
    public void service(ServletRequest request, ServletResponse response)
        throws ServletException, IOException {

        // Get the user input from the request parameters
        String userInput = request.getParameter("userInput");

        // Validate the user input to prevent XSS attacks
        // In this example, we'll simply escape any double quotes and less-than symbols
        userInput = userInput.replaceAll("\"", "&quot;").replaceAll("<", "&lt;");

        // Write the validated user input to the response
        PrintWriter out = response.getWriter();
        out.print("User Input: " + userInput);
    }
}
```

In the fixed code, we've replaced the use of the getReader() method with the getParameter() method, which allows us to read user input from the request parameters. We've also added input validation to escape any potentially harmful characters, such as double quotes and less-than symbols, to prevent XSS attacks.

